CREATE TABLE  categoria(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL,
    is_activa boolean DEFAULT true

);



CREATE TABLE  sub_categoria(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL,
    is_activa boolean DEFAULT true,
    categoria_id INT,
    FOREIGN KEY (categoria_id) REFERENCES categoria(id)
);



CREATE TABLE  variedad(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(60) NOT NULL
 
);


CREATE TABLE bodega(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL

);


CREATE TABLE producto (
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    precio DECIMAL(6,2) NOT NULL,
    descripcion clob,
    stock int NOT NULL,
    imagen clob NOT NULL,
    is_disponible BOOLEAN NOT NULL,
    sub_categoria_id INT NOT NULL,
    bodega_id INT NOT NULL,
    variedad_id INT ,
    FOREIGN KEY (sub_categoria_id) REFERENCES sub_categoria(id),
    FOREIGN KEY (bodega_id) REFERENCES bodega(id),
    FOREIGN KEY (variedad_id) REFERENCES variedad(id)
);

CREATE TABLE  promocion(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    precio DECIMAL(6,2) NOT NULL,
    producto_id INT,
    FOREIGN KEY (producto_id) REFERENCES producto(id)
    
);

CREATE TABLE "role" (
  id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
  rol varchar(255) DEFAULT NULL

);

CREATE TABLE  "user"(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    email VARCHAR(100) UNIQUE NOT NULL,
    password VARCHAR(68) NOT NULL,
    is_activo BOOLEAN DEFAULT true
  
);  

CREATE TABLE user_role (
  user_id INT NOT NULL,
  role_id INT NOT NULL,
  FOREIGN KEY (user_id) REFERENCES "user"(id),
  FOREIGN KEY (role_id) REFERENCES "role"(id)
); 

CREATE TABLE  cliente(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    nombre VARCHAR(100) NOT NULL,
    apellido VARCHAR(100) NOT NULL,
    telefono VARCHAR(60),
    user_id INT ,
    FOREIGN KEY (user_id) REFERENCES "user"(id)
);  

CREATE TABLE  domicilio(
    cliente_id INT, 
    calle VARCHAR(100) NOT NULL,
    numero INT NOT NULL,
    piso INT,
    departamento VARCHAR(100),
    localidad VARCHAR(100) NOT NULL,
    codigo_postal INT NOT NULL,
     FOREIGN KEY (cliente_id) REFERENCES cliente(id)
);

CREATE TABLE  orden_cliente(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    total DECIMAL(6,2) NOT NULL,
    fecha_creacion TIMESTAMP,
    numero_confirmacion INT NOT NULL,
    cliente_id INT NOT NULL,
    FOREIGN KEY (cliente_id) REFERENCES cliente(id)
);

CREATE TABLE orden_cliente_producto(
    orden_cliente_id INT NOT NULL,
    producto_id INT NOT NULL,
    cantidad INT,
    FOREIGN KEY (orden_cliente_id) REFERENCES orden_cliente(id),
    FOREIGN KEY (producto_id) REFERENCES producto(id)
);

CREATE TABLE  carrito_item(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    cantidad int NOT NULL,
    producto_id int,
    FOREIGN KEY (producto_id) REFERENCES producto(id)
  
);

CREATE TABLE  carrito(
    id INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1, INCREMENT BY 1) PRIMARY KEY not null,
    numero_de_items int NOT NULL,
    total DECIMAL(6,2) NOT NULL,
    carrito_item_id int,
    cliente_id int,
     FOREIGN KEY (carrito_item_id) REFERENCES carrito_item(id),
     FOREIGN KEY (cliente_id) REFERENCES cliente(id)
);

